import React from "react";

import { ContactContainer,  ContactList, ContactIcon, ContactLi, ContactLogo} from "./PageElements";
import mailIcon from "../assets/mailIcon.png";
import phoneIcon from "../assets/phoneIcon.png";
import githubIcon from "../assets/githubIcon.png";
import linkedInIcon from "../assets/linkedInIcon.png";
import conLogo from "../assets/Con2.png"
const Contact = () => {
  return (
    <ContactContainer>
      <div><ContactLogo src = {conLogo}/> <h1>tact Points</h1></div>
      <ContactList>
        <ContactLi>
          <ContactIcon src={mailIcon} />davis.con@northeastern.edu
        </ContactLi>
        <ContactLi>
          <ContactIcon src={phoneIcon} style={{width: "55px", marginLeft: "-8px", paddingRight:"10px"}}/>631.935.4505

        </ContactLi>
        <ContactLi>
          <ContactIcon src={githubIcon} />conDavis
        </ContactLi>
        <ContactLi>
          <ContactIcon src={linkedInIcon}/>Constance Davis
        </ContactLi>
      </ContactList>
      <p>I'd love to talk</p>
    </ContactContainer>
  );
};

export default Contact;
